import { products, user } from './App';

export function App() {
  let isLoggedIn = true;
  let content;

  isLoggedIn ? content = "hello1" : content = "hello2";

  const listItems = products.map(product => <li key={product.id}>
    style='magenta'
    {product.title}
  </li>
  );
  return (
    <div className="App">
      <ul>{listItems}</ul>
      <h1>{content}</h1>
      <img
        className="avatar"
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }} />
    </div>

  );
}
